  deviceLog?: Prisma.DeviceLogOmit
  bandApplication?: Prisma.BandApplicationOmit
  bandApplicationTag?: Prisma.BandApplicationTagOmit
  bandApplicationRating?: Prisma.BandApplicationRatingOmit
  bandApplicationComment?: Prisma.BandApplicationCommentOmit
  event?: Prisma.EventOmit
  bandPlaying?: Prisma.BandPlayingOmit
  nonce?: Prisma.NonceOmit
  nonceRequest?: Prisma.NonceRequestOmit
  gmailReminders?: Prisma.GmailRemindersOmit
  devicePrivilegeToken?: Prisma.DevicePrivilegeTokenOmit
